import FunctionalComponent from "./FunctionalComponent";
    
const routes = [
    {
        label: "Cossette's Functional Component",
        path: "/FunctionalComponent",
        component: FunctionalComponent,
        exact: true,
        showNav: true
    },
]
    
export default routes;
